import Vue from "vue";
import Router from "vue-router";
import HomePage from "@/views/HomePage.vue";  // Ganti Home.vue dengan HomePage.vue

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: "/",
      name: "HomePage",  // Sesuaikan dengan nama komponen yang baru
      component: HomePage,
    },
  ],
});
